import styled from "styled-components";
import React from 'react';

export default function Skills({language}) {

  return (
    <Container >
        {!language ? <>
            <List>
                <h1>Habilidades</h1>
                <h4>Hard Skills</h4>
                <h2>Fullstack</h2>
                <h3>- CSS</h3>
                <h3>- HTML</h3>
                <h3>- Javascript</h3>
                <h3>- Typescript</h3>
                <h3>- React</h3>
                <h2>Banco de dados</h2>
                <h3>- MongoDB</h3>
                <h3>- PostgreSQL</h3>
                <h3>- Prisma</h3>
                <h2>Técnicas com IAs</h2>
                <h3>- Supervised Machine Learning</h3>
                <h2>Técnicas de Engenharia</h2>
                <h3>- Cálculo avançado</h3>
                <h3>- Métodos com estátistica e probabilidade</h3>
                <h3>- Noções de manuseio com Hardware</h3>
                <h4>Soft Skills</h4>
                <h3>- Trabalho em equipe</h3>
                <h3>- Receptivo à feedbacks</h3>
                <h3>- Solução de problemas </h3>
                <h5>- Flexibilidade e Adaptação</h5>
            </List>
            <div>
                <h2>Linguagens</h2>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
                <img src="/assets/poli.png" alt="Logo Poli"/>
            </div>
            </> :
            <>
                <h1>Skills</h1>
                <h4>Hard Skills</h4>
                <h2>Fullstack</h2>
                <h3>- CSS</h3>
                <h3>- HTML</h3>
                <h3>- Javascript</h3>
                <h3>- Typescript</h3>
                <h3>- React</h3>
                <h2>Database</h2>
                <h3>- MongoDB</h3>
                <h3>- PostgreSQL</h3>
                <h3>- Prisma</h3>
                <h2>AI Techniques</h2>
                <h3>- Supervised Machine Learning</h3>
                <h2>Engineering Techniques</h2>
                <h3>- Advanced Calculus</h3>
                <h3>- Methods with Statistics and Probability</h3>
                <h3>- Basic Hardware Handling Skills</h3>
                <h4>Soft Skills</h4>
                <h3>- Teamwork</h3>
                <h3>- Receptive to Feedback</h3>
                <h3>- Problem Solving</h3>
                <h5>- Flexibility and Adaptation</h5>
            </>}
    </Container>
  );
}

const Container = styled.div`
    padding-left: 5%;
    padding-right: 5%;
    display: flex;
    background-color: #080808;

    div {
        display: flex;
    }

    h1{
        padding-top: 10vh;
        font-size: 40px;
        font-weight: 700;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h2 {
        padding-top: 9px;
        font-size: 16px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h3 {
        padding-top: 4px;
        padding-left: 10px;
        font-size: 14px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h4 {
        padding-top: 14px;
        font-size: 20px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h5 {
        padding-top: 4px;
        padding-left: 10px;
        font-size: 14px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    img {
        height: 8vh;
        width: 8vw;
    }
`

const List = styled.div`
    display: flex;
    flex-direction: column;
    flex-wrap: wrap;
`

const Language = styled.div`
    display: flex;
    flex-wrap: wrap;


`
